import styles from './styles.module.css';

 const Responses = () => {
    return (
    <div className={styles.boxContainer}>
      <input type="text" className={styles.styledBox} placeholder="Textbox 1" />
      <input type="text" className={styles.styledBox} placeholder="Textbox 2" />
      <input type="text" className={styles.styledBox} placeholder="Textbox 3" />
      <input type="text" className={styles.styledBox} placeholder="Textbox 4" />
    </div>
    )
}

export default Responses;
